import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "./pages/Home";
import New from "./pages/New";
import Edit from "./pages/Edit";
import Diary from "./pages/Diary";
import RouteTest from "./components/RouteTest";
import MyButton from "./components/MyButton";
import Myheader from "./components/Myheader";

function App() {

  return (
      <BrowserRouter>
        <div className="App">
            <Myheader headText={"App"}
                      leftChild={<MyButton text={"왼쪽 버튼"} onClick={() => alert("왼쪽 클릭")}/> }
                      rightChild={<MyButton text={"오른쪽 버튼"} onClick={() => alert("오른쪽 클릭")}/>
            }/>
            <h2>App.js</h2>

            <MyButton text="버튼" onClick={()=>alert("버튼 클릭")} type={"positive"}></MyButton>
            <MyButton text="버튼" onClick={()=>alert("버튼 클릭")} type={"negative"}></MyButton>
            <MyButton text="버튼" onClick={()=>alert("버튼 클릭")} type={""}></MyButton>
            <Routes>
                <Route path="/" element={<Home/>}></Route>
                <Route path="/new" element={<New/>}></Route>
                <Route path="/edit" element={<Edit/>}></Route>
                <Route path="/diary/:id" element={<Diary/>}></Route>
            </Routes>
        </div>
      </BrowserRouter>
  );
}

export default App;
